        <div className="titleModal">
          project: <b>{title}</b>
        </div>
        <div className="titleModal">
          client: <b>{client}</b>
        </div>
        <div className="titleModal descModal">
          <b>Description:</b>
          <br />
          {description}
        </div>
      </div>
      <div className="pictsModal">
        <img src={modalPict} alt="" className="imgModal" />
        <div className="bulletNav">
          {dots.map((_, i) => (
            <div key={i} className="dot" onClick={() => changeDisplay(i)} >â€¢</div>
          ))}
        </div>
      </div>
    </>
  );
};

